{"operationName":"dayDatasQuery","variables":{"first":1},"query":"query dayDatasQuery($first: Int! = 1, $date: Int! = 0) {
  dayDatas(first: $first, orderBy: date, orderDirection: desc) {
    id
    date
    volumeETH
    volumeUSD
    untrackedVolume
    liquidityETH
    liquidityUSD
    txCount
    __typename
  }
}
"}
